// PARENT
import OfferHero from "./OfferHero";

let data = {
  hero1: "Buen fin en 85%",
  hero2: "Buen fin en 70%",
};
function Offer() {
  let changeOffers = () => {
    data.hero1 = "Buen fin es 10%";
    data.hero2 = "Buen fin en 15%";
  };
  return (
    <div>
      <OfferHero hero1={data.hero1} hero2={data.hero2} />
      <button>Change Offers{changeOffers}</button>
    </div>
  );
}

export default Offer;
